import { useEffect, useState } from 'react';
import { useProductsContext } from '../hooks/useProductsContext';
import { useNavigate } from 'react-router-dom';
import { useParams } from 'react-router-dom';

const UpdatePage = () => {
  const { dispatch } = useProductsContext();
  const navigate = useNavigate(); // Hook for programmatic navigation
  const {id} = useParams()

  const [name, getName] = useState('');
  const [category, getCategory] = useState('');
  const [supplier, getSupplier] = useState('');
  const [description, getDescription] = useState('');
  const [quantity, getQuantity] = useState('');
  const [reOrderLevel, getReOrderLevel] = useState('');
  const [price, getPrice] = useState('');
  const [error, setError] = useState(null);
  const [emptyFields, setEmptyFields] = useState([]);

  useEffect(() => {
    fetch(`http://localhost:3065/`+id)
    .then(result => (result.data))
    .catch((err)=> console.log("Error", err));
  })
  const handleSubmit = async (e) => {
    e.preventDefault();

    const product = { name, category, supplier, description, quantity, reOrderLevel, price };

    const response = await fetch('/api/products/:id', {
      method: 'PUT',
      body: JSON.stringify(product),
      headers: {
        'Content-Type': 'application/json',
      },
    });
    const json = await response.json();

    if (!response.ok) {
      setError(json.error);
      setEmptyFields(json.emptyFields);
    }
    if (response.ok) {
      getName('');
      getCategory('');
      getSupplier('');
      getDescription('');
      getQuantity('');
      getReOrderLevel('');
      getPrice('');
      setError(null);
      setEmptyFields([]);
      console.log('Product Updated', json);
      dispatch({ type: 'UPDATE_PRODUCT', payload: json });

      // Redirect to the home page
      navigate('/');
    }
  }


    return (
        <div className="home">
        <form className="create" onSubmit={handleSubmit}>
            <h3>Add a new Product</h3>

            <label>Product Name :</label>
            <input
                type='text'
                onChange={(e) => getName(e.target.value)}
                value={name}
                className={emptyFields.includes('name') ? 'error' : ''}
            />

            <label>Category :</label>
            <input
                type='text'
                onChange={(e) => getCategory(e.target.value)}
                value={category}
                className={emptyFields.includes('category') ? 'error' : ''}
            />

            <label>Supplier :</label>
            <input
                type='text'
                onChange={(e) => getSupplier(e.target.value)}
                value={supplier}
                className={emptyFields.includes('supplier') ? 'error' : ''}
            />

            <label>Description :</label>
            <input
                type='text'
                onChange={(e) => getDescription(e.target.value)}
                value={description}
                className={emptyFields.includes('description') ? 'error' : ''}
            />

            <label>Quantity:</label>
            <input
                type='number'
                onChange={(e) => getQuantity(e.target.value)}
                value={quantity}
                className={emptyFields.includes('quantity') ? 'error' : ''}
            /> 

            <label>Re-OrderLevel:</label>
            <input
                type='number'
                onChange={(e) => getReOrderLevel(e.target.value)}
                value={reOrderLevel}
                className={emptyFields.includes('reOrderLevel') ? 'error' : ''}
            /> 

            <label>Price:</label>
            <input
                type='number'
                onChange={(e) => getPrice(e.target.value)}
                value={price} 
                className={emptyFields.includes('price') ? 'error' : ''}
            />

            <button>Add Product</button>
            {error && <div className="error">{error}</div>}
        </form>
        </div>
    )
}

export default UpdatePage
